class Interval(object):
    def __init__(self, start, end):
        self.start = start
        self.end = end


class Solution:
    """
    @param a: the array a
    @return: return the minimal points number
    """

    def get_ans(self, a):
        # write your code here
        L = len(a)

        a = sorted(a, key=lambda x: (x.start, x.end))
        prev = a[0]
        scope = [prev.start, prev.end]
        ans = 1
        for x in range(1, L):
            curr = a[x]
            if scope[0] <= curr.start <= scope[1]:
                scope[0] = max(scope[0], curr.start)
                scope[1] = min(scope[1], curr.end)
            else:
                ans += 1
                scope = [curr.start, curr.end]
        return ans


